import './App.css';
import NavBar from './components/navbar/Navbar';
import {Route,Routes} from "react-router-dom"
import {Home} from "./pages/Home"




function App() {
  return (
    <Routes>
      <header><NavBar/></header>
      <Route path="/" element ={< Home/>}/>


    </Routes>

  );
}

export default App;
